// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awCheckboxValRenderFunction } from 'js/AwCheckboxValService';


/*
ctx imports
*/
import { getValClassMemo as valClass } from 'js/componentUtils';
const ctxImportObj = { valClass };


/*
dynamic import
 */
registerDynImportEntry('js/AwCheckboxValService', () => import('js/AwCheckboxValService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awCheckboxValRenderFunction",
            "deps": "js/AwCheckboxValService"
        }
    },
    "props": {
        "action": {
            "type": "action"
        },
        "prop": {
            "type": "field"
        },
        "is-negated": {
            "type": "object"
        }
    },
    "ctx": {
        "valClass": {
            "parser": {
                "method": "getValClassMemo",
                "deps": "js/componentUtils"
            }
        }
    },
    "data": {},
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "AwCheckboxVal",
    "_uniqueViewModelId": "AwCheckboxVal"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awCheckboxValRenderFunction, undefined, ctxImportObj );

export default Component;
